  return (
    <div className="bg-slate-50 h-screen flex justify-center items-center">
      <h1 className="text-center">THE HOME OF MILITARY MENTAL HEALTH</h1>
      <img src={backgroundimage} className=""/>
    </div>
  );
}

export default Dashboard;
